import React from "react";
import { Link } from "react-router-dom";
import "./Profile.css";

export const Profile = () => {
  return (
    <div className="profile-container">
      <h1 className="profile-title animate__animated animate__fadeInDown">Имя Человека</h1>
      <div className="profile-image-container animate__animated animate__fadeIn">
        <img 
          src="images/ProfilePicture.jpg" 
          className="profile-image" 
          width={250} 
          height={250} 
          alt="ProfilePicture" 
          loading="lazy"
        />
      </div>
      <div className="profile-description animate__animated animate__fadeInUp">
        <p>Описание</p>
      </div>
    </div>
  );
};

export default Profile;
